    private Maintenance Maintenance { get; set; } = new Maintenance();
    public IEnumerable<Car> Cars { get; set; }

    public string ButtonText { get; set; } = "Create";
    public string ButtonType { get; set; } = "btn-success";

    [CascadingParameter]
    public int Id { get; set; }

    protected async override Task OnInitializedAsync()
    {
        Cars = await CarRepository.GetAllAsync();

        if (Id != 0)
        {
            ButtonText = "Update";
            ButtonType = "btn-warning";
            Maintenance = await MaintenanceRepository.FindAsync(Id);
        }
        else
        {
            Maintenance.CarId = Cars.FirstOrDefault().CarId;
        }
    }

    async Task HandleValidSubmit()
    {
        if (Id != 0)
        {
            await MaintenanceRepository.UpdateAsync(Maintenance);
        }
        else
        {
            await MaintenanceRepository.AddAsync(Maintenance);
        }
    }

